import React from "react";

function Home() {
  return (
    <div className="" height={"100vh"}>
      <div className="container">
        <div className="row justify-content-center align-items-center">
          <div className="col-6">
            <p className="display-4">
              Bringing <span>Ideas</span> To Our <span>Reality</span>
            </p>
            <span className="px-2 fs-4 py-1 rounded-2 bg-dark text-light">
              Explore
            </span>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
